import React from 'react';
import './App.css';
import CreateTicket from './CreateTicket';
import UpdateTicketPrice from './UpdateTicketPrice';
import ValidateTicket from './ValidateTicket';

const App = () => {
  return (
    <div className="App">
      <h1>Ticket Management System</h1>
      <CreateTicket />
      <UpdateTicketPrice />
      <ValidateTicket />
    </div>
  );
};

export default App;
